		"forceW":["CannonBall","MSCM","Rocket Propelled Grenade"],
		"r":[240,50,267],
		"tamingNote": {
			"en":"To tame an Astrocetus, you must first knock it out by hitting its head. Using a Cannon mounted on a Tek Skiff is a common knock out technique. Use the Tips feature to share your Astrocetus taming strategy!",
			"ar":"لإلقاء القبض على Astrocetus، يجب أن تضربه أولاً على رأسه ليغشى عليه. استخدام مدفع مثبت على Tek Skiff هو تقنية شائعة للإغشاء. استخدم ميزة النصائح لمشاركة استراتيجيتك في ترويض Astrocetus!",
			"cs":"Chcete-li zkrotit Astrocetus, musíte ho nejprve omráčit úderem do hlavy. Běžnou technikou omráčení je použití děla namontovaného na Tek Skiff. Využijte funkci Tipů k sdílení své strategie pro zkrocení Astrocetus!",
			"da":"For at tæmme en Astrocetus skal du først slå den ud ved at ramme dens hoved. At bruge en kanon monteret på en Tek Skiff er en almindelig udslåningsteknik. Brug Tips funktionen til at dele din Astrocetus tæmningsstrategi!",
			"de":"Um einen Astrocetus zu zähmen, musst du ihn zuerst bewusstlos schlagen, indem du auf seinen Kopf schlägst. Eine Kanone, die auf einem Tek Skiff montiert ist, ist eine gängige Methode, um ihn außer Gefecht zu setzen. Verwende die Tipps-Funktion, um deine Astrocetus-Zähmungsstrategie zu teilen!",
			"es":"Para domesticar un Astrocetus, primero debes noquearlo golpeándolo en la cabeza. Usar un Cañón montado en un Tek Skiff es una técnica común de noqueo. ¡Usa la función de Consejos para compartir tu estrategia de domesticación de Astrocetus!",
			"fi":"Astrocetuksen kesyttämiseksi sinun on ensin lyötävä se tajuttomaksi lyömällä sen päätä. Tykki, joka on asennettu Tek Skiffiin, on yleinen tapa tehdä se tajuttomaksi. Jaa Astrocetuksen kesyttämisstrategiasi Vinkit-toiminnolla!",
			"fr":"Pour apprivoiser un Astrocetus, vous devez d'abord l'assommer en frappant sa tête. L'utilisation d'un canon monté sur un Tek Skiff est une technique d'assommage courante. Utilisez la fonctionnalité Conseils pour partager votre stratégie d'apprivoisement d'Astrocetus !",
			"el":"Για να εξημερώσετε ένα Astrocetus, πρέπει πρώτα να το βαρέσετε στο κεφάλι για να το λιποθυμήσετε. Η χρήση ενός κανονιού που τοποθετείται σε ένα Tek Skiff είναι μια κοινή τεχνική λιποθυμίας. Χρησιμοποιήστε τη λειτουργία Συμβουλών για να μοιραστείτε τη στρατηγική σας για την εξημέρωση του Astrocetus!",
			"he":"כדי לרדוף Astrocetus, עליך קודם כל להכות בראשו כדי שיתעלף. שימוש בתותח המותקן על Tek Skiff הוא טכניקה נפוצה להעלמה. השתמש בתכונת הטיפים כדי לשתף את אסטרטגיית הרדיפה שלך!",
			"hr":"Da biste ukrotili Astrocetus, prvo ga morate onesvijestiti udarcem u glavu. Korištenje topa montiranog na Tek Skiffu je uobičajena tehnika za onesvješćivanje. Koristite funkciju Savjeti za dijeljenje svoje strategije za ukroćivanje Astrocetusa!",
			"id":"Untuk menjinakkan Astrocetus, Anda harus memukul kepala mereka terlebih dahulu untuk membuatnya pingsan. Menggunakan Meriam yang dipasang di Tek Skiff adalah teknik pingsan yang umum. Gunakan fitur Tips untuk membagikan strategi penjinakan Astrocetus Anda!",
			"it":"Per addomesticare un Astrocetus, devi prima stordirlo colpendolo in testa. L'utilizzo di un Cannone montato su un Tek Skiff è una tecnica comune di stordimento. Usa la funzione Suggerimenti per condividere la tua strategia di addomesticamento dell'Astrocetus!",
			"ja":"Astrocetusを飼いならすには、まずその頭を打って気絶させなければなりません。Tek Skiffに取り付けられたキャノンを使用するのが一般的な気絶技術です。ヒント機能を使用して、あなたのAstrocetusの飼いならし戦略を共有してください!",
			"ko":"Astrocetus를 길들이려면 먼저 머리를 치고 기절시켜야 합니다. Tek Skiff에 장착된 대포를 사용하는 것이 일반적인 기절 기술입니다. 팁 기능을 사용하여 Astrocetus 길들이기 전략을 공유하세요!",
			"lv":"Lai pieradinātu Astrocetus, vispirms jānogalina tas, sitot pa galvu. Lielgabala izmantošana, kas piestiprināts pie Tek Skiff, ir izplatīta nogalināšanas tehnika. Izmantojiet padomu funkciju, lai dalītos ar savu Astrocetus pieradināšanas stratēģiju!",
			"nb":"For å temme en Astrocetus, må du først slå den ut ved å treffe hodet dens. Bruk av en kanon montert på en Tek Skiff er en vanlig utslåingsteknikk. Bruk Tips-funksjonen for å dele din Astrocetus-temmingsstrategi!",
			"nl":"Om een Astrocetus te temmen, moet je hem eerst knock-out slaan door op zijn kop te slaan. Het gebruik van een kanon dat op een Tek Skiff is gemonteerd, is een gebruikelijke knock-out techniek. Gebruik de Tips-functie om je Astrocetus temmingsstrategie te delen!",
			"pl":"Aby oswoić Astrocetus, najpierw musisz go znokautować uderzając go w głowę. Użycie armaty zamontowanej na Tek Skiff to powszechna technika nokautowania. Użyj funkcji Wskazówek, aby podzielić się swoją strategią oswojenia Astrocetus!",
			"pt-br":"Para domesticar um Astrocetus, você deve primeiro nocauteá-lo acertando sua cabeça. Usar um Canhão montado em um Tek Skiff é uma técnica comum de nocaute. Use o recurso Dicas para compartilhar sua estratégia de domesticação de Astrocetus!",
			"ro":"Pentru a îmblânzi un Astrocetus, trebuie mai întâi să-l doborâți lovindu-l în cap. Utilizarea unui tun montat pe un Tek Skiff este o tehnică comună de doborâre. Utilizați funcția de Sfaturi pentru a împărtăși strategia dvs. de îmblânzire a Astrocetus!",
			"ru":"Чтобы приручить Astrocetus, вы должны сначала выбить его, ударив по голове. Использование пушки, установленной на Tek Skiff, - это общая техника нокаута. Используйте функцию Советы, чтобы поделиться своей стратегией приручения Astrocetus!",
			"th":"ในการจับ Astrocetus คุณต้องทำให้มันเป็นอัมพาตโดยการตบหัวมันก่อน การใช้ปืนใหญ่ที่ติดตั้งบน Tek Skiff เป็นเทคนิคที่ทำให้สัตว์เป็นอัมพาตที่ทั่วไป ใช้คุณสมบัติคำแนะนำเพื่อแบ่งปันกลยุทธ์ในการจับ Astrocetus ของคุณ!",
			"tr":"Bir Astrocetus'u evcilleştirmek için öncelikle başını vurarak onu bayıltmalısınız. Tek Skiff üzerine monte edilmiş bir Top kullanmak yaygın bir bayıltma tekniğidir. Astrocetus evcilleştirme stratejinizi paylaşmak için İpuçları özelliğini kullanın!",
			"vi":"Để thuần chủng một Astrocetus, bạn phải đầu tiên làm cho nó bất tỉnh bằng cách đánh vào đầu của nó. Sử dụng một Pháo được gắn trên một Tek Skiff là một kỹ thuật thông thường để làm cho nó bất tỉnh. Sử dụng tính năng Gợi ý để chia sẻ chiến lược thuần chủng Astrocetus của bạn!",
			"zh":"要驯服Astrocetus，你必须首先击昏它，方法是打它的头部。使用装在Tek Skiff上的大炮是常见的击昏技术。使用“提示”功能分享你的Astrocetus驯服策略！",
			"zh-tw":"要馴服Astrocetus，您必須先敲昏它，方法是打它的頭部。使用裝在Tek Skiff上的大砲是一種常見的擊昏技巧。使用「小提示」功能分享您的Astrocetus馴服策略！"
		},
