		"tamingNote": {
			"en": "The Deinonychus can only be tamed by raising it from an egg. Have a good strategy on obtaining Deinonychus eggs and raising them? Share it as a taming tip!",
			"ar": "يمكن ترويض Deinonychus فقط عن طريق تربيته من بيضة. هل لديك استراتيجية جيدة للحصول على بيض Deinonychus وتربيته؟ شاركها كنصيحة للترويض!",
			"cs": "Deinonychus lze ochočit pouze vychováním z vejce. Máte dobrou strategii, jak získat vejce Deinonychus a vychovávat je? Sdílejte ji jako tip na ochočování!",
			"da": "Deinonychus kan kun tæmmes ved at opfostre den fra et æg. Har du en god strategi til at indhente Deinonychus-æg og opfostre dem? Del det som en tæmmetip!",
			"de": "Der Deinonychus kann nur gezähmt werden, indem man ihn aus einem Ei aufzieht. Haben Sie eine gute Strategie, um Deinonychus-Eier zu bekommen und sie aufzuziehen? Teilen Sie es als Zähmungstipp!",
			"es": "El Deinonychus solo puede ser domesticado al criarlo desde un huevo. ¿Tienes una buena estrategia para obtener huevos de Deinonychus y criarlos? ¡Compártela como un consejo de domesticación!",
			"fi": "Deinonychus voidaan kesyttää vain kasvattamalla se munasta. Onko sinulla hyvä strategia Deinonychus-munien hankkimiseen ja kasvattamiseen? Jaa se kesyttämisvinkkinä!",
			"fr": "Le Deinonychus ne peut être apprivoisé qu'en l'élevant depuis un œuf. Avez-vous une bonne stratégie pour obtenir des œufs de Deinonychus et les élever ? Partagez-la en tant qu'astuce d'apprivoisement !",
			"el": "Ο Deinonychus μπορεί να εξημερωθεί μόνο ανατρέφοντάς τον από ένα αυγό. Έχετε καλή στρατηγική για την απόκτηση αυγών Deinonychus και την ανατροφή τους; Μοιραστείτε το ως συμβουλή εξημέρωσης!",
			"he": "ניתן לאמץ את ה-Deinonychus רק על ידי גידולו מביצה. יש לך אסטרטגיה טובה להשגת ביצות Deinonychus ולגדלן? שתף זאת כטיפ לאימוץ!",
			"hr": "Deinonychus se može pripitomiti samo uzgojem iz jajeta. Imate li dobru strategiju za dobivanje Deinonychus jaja i njihov uzgoj? Podijelite to kao savjet za pripitomljavanje!",
			"id": "Deinonychus hanya bisa dijinakkan dengan menetaskannya dari telur. Punya strategi bagus dalam mendapatkan telur Deinonychus dan menetaskannya? Bagikan sebagai tip penjinakkan!",
			"it": "Il Deinonychus può essere addomesticato solo allevandolo da un uovo. Hai una buona strategia per ottenere uova di Deinonychus e allevare loro? Condividilo come un consiglio per l'addomesticamento!",
			"ja": "Deinonychusは、卵から育てることでしか飼いならすことができません。Deinonychusの卵を入手し、育てるための良い戦略はありますか？それを飼いならすためのヒントとして共有してください！",
			"ko": "Deinonychus는 알에서 키워서만 길들일 수 있습니다. Deinonychus 알을 얻고 키우는 좋은 전략이 있습니까? 길들이는 팁으로 공유하세요!",
			"lv": "Deinonychus var pieradināt tikai audzējot to no olas. Vai jums ir laba stratēģija, kā iegūt Deinonychus olas un audzēt tās? Dalieties ar to kā pieradināšanas padomu!",
			"nb": "Deinonychus kan bare temmes ved å oppdra den fra et egg. Har du en god strategi for å skaffe Deinonychus-egg og oppdra dem? Del det som et temmingstips!",
			"nl": "De Deinonychus kan alleen worden getemd door het op te voeden vanuit een ei. Heb je een goede strategie om Deinonychus-eieren te verkrijgen en op te voeden? Deel het als een tamings-tip!",
			"pl": "Deinonychus można oswoić tylko poprzez hodowlę go z jajka. Czy masz dobrą strategię na zdobycie jaj Deinonychus i wychowywanie ich? Podziel się nią jako wskazówką do oswojenia!",
			"pt-br": "O Deinonychus só pode ser domesticado ao ser criado a partir de um ovo. Você tem uma boa estratégia para obter ovos de Deinonychus e criá-los? Compartilhe como uma dica de domesticação!",
			"ro": "Deinonychus poate fi îmblânzit doar crescându-l dintr-un ou. Aveți o strategie bună pentru obținerea ouălor de Deinonychus și creșterea lor? Împărtășiți-o ca un sfat de îmblânzire!",
			"ru": "Deinonychus может быть приручен только путем выращивания из яйца. У вас есть хорошая стратегия по получению яиц Deinonychus и выращиванию их? Поделитесь этим как советом по приручению!",
			"th": "Deinonychus สามารถถูกทำให้เป็นขภาพได้เฉพาะเมื่อเลี้ยงมันจากไข่ มีกลยุทธ์ที่ดีในการรับไข่ Deinonychus และการเลี้ยงพวกมันหรือไม่? แบ่งปันเป็นเคล็ดลับในการทำให้เป็นขภาพ!",
			"tr": "Deinonychus sadece bir yumurtadan yetiştirilerek evcilleştirilebilir. Deinonychus yumurtası elde etme ve onları yetiştirme konusunda iyi bir stratejiniz var mı? Onu bir evcilleştirme ipucu olarak paylaşın!",
			"vi": "Deinonychus chỉ có thể được thuần hóa bằng cách nuôi dưỡng nó từ một quả trứng. Bạn có chiến lược tốt để lấy trứng Deinonychus và nuôi dưỡng chúng không? Chia sẻ nó như một mẹo thuần hóa!",
			"zh": "只能通过从蛋开始养育来驯服Deinonychus。有获取Deinonychus蛋并养育它们的好策略吗？将其分享为驯化提示！",
			"zh-tw": "只能從蛋開始飼養Deinonychus。有獲取Deinonychus蛋並飼養他們的好策略嗎？將它分享為馴化的提示！"
		},
		"desc":"The Deinonychus is an agile dino with sharp claws that can pounce and feed on its victim. The Deinonychus can also climb up walls by jumping. This creature is able to climb by jumping from wall to wall. It is very territorial around its nest.",
