		"tamingNote":{
			"en": "The Desmodus is a passive tame. Put Blood Packs on your hot bar and let it grab you. It will consume 10 Blood Packs over a short period of time, then drop you. Repeat until tamed.",
			"ar": "الدسمودوس هو ترويض سلبي. ضع حقائب الدم في شريطك الساخن ودعه يمسك بك. سوف يستهلك 10 حقائب دم خلال فترة قصيرة من الزمن، ثم يسقطك. كرر حتى يتم الترويض.",
			"cs": "Desmodus je pasivní ochočení. Dejte krevní balíčky na svůj rychlý pruh a nechte ho, aby vás chytil. Spotřebuje 10 krevních balíčků za krátkou dobu, pak vás upustí. Opakujte, dokud není ochočen.",
			"da": "Desmodus er en passiv tamning. Læg blodpakker på din hotbar og lad den gribe dig. Den vil forbruge 10 blodpakker over en kort periode, derefter droppe dig. Gentag indtil tam.",
			"de": "Der Desmodus ist eine passive Zähmung. Legen Sie Blutpackungen auf Ihre Schnellzugriffsleiste und lassen Sie sich greifen. Er wird 10 Blutpackungen über einen kurzen Zeitraum verbrauchen und Sie dann fallen lassen. Wiederholen Sie dies, bis er gezähmt ist.",
			"es": "El Desmodus es un domesticado pasivo. Coloca paquetes de sangre en tu barra de acceso rápido y déjalo agarrarte. Consumirá 10 paquetes de sangre en un corto período de tiempo, luego te soltará. Repite hasta que esté domesticado.",
			"fi": "Desmodus on passiivinen kesyttäjä. Laita Veripakkaus kuumaan baariisi ja anna sen tarttua sinuun. Se kuluttaa 10 Veripakkausta lyhyessä ajassa, sitten pudottaa sinut. Toista kunnes kesytetty.",
			"fr": "Le Desmodus est un apprivoisement passif. Mettez des sacs de sang sur votre barre d'outils et laissez-le vous attraper. Il consommera 10 sacs de sang en peu de temps, puis vous lâchera. Répétez jusqu'à ce qu'il soit apprivoisé.",
			"el": "Το Desmodus είναι ένα παθητικό ζώο. Βάλτε τις συσκευασίες αίματος στη ζεστή σας μπάρα και αφήστε το να σας πιάσει. Θα καταναλώσει 10 συσκευασίες αίματος σε μικρό χρονικό διάστημα, έπειτα θα σας αφήσει. Επαναλάβετε μέχρι να εξημερωθεί.",
			"he": "הדסמודוס הוא חייה פסיבי. הנח את חבילות הדם בסרגל המהיר שלך ותן לו לתפוס אותך. הוא יצרוך 10 חבילות דם במהלך תקופה קצרה של זמן, ואז יזרוק אותך. חזור על זה עד שהוא מאולף.",
			"hr": "Desmodus je pasivna dresura. Stavite pakete krvi na svoju vruću traku i pustite da vas zgrabi. Potrošit će 10 paketa krvi u kratkom vremenskom razdoblju, a zatim vas ispustiti. Ponavljajte dok nije dresiran.",
			"id": "Desmodus adalah penjinakan pasif. Letakkan Paket Darah di hot bar Anda dan biarkan ia menangkap Anda. Dia akan mengkonsumsi 10 Paket Darah dalam waktu singkat, lalu menjatuhkan Anda. Ulangi hingga jinak.",
			"it": "Il Desmodus è un addomesticamento passivo. Metti le sacche di sangue sulla tua barra delle opzioni rapide e lascia che ti prenda. Consumerà 10 sacche di sangue in un breve periodo di tempo, poi ti mollerà. Ripeti fino a quando non è addomesticato.",
			"ja": "デスモドゥスはパッシブテイムです。ホットバーにブラッドパックを置き、それがあなたを捕まえるのを待ちます。それは短時間で10のブラッドパックを消費し、その後あなたを落とします。テイムするまで繰り返します。",
			"ko": "데스모두스는 수동 테이밍입니다. 핫바에 블러드 팩을 두고 그것이 당신을 잡게 두십시오. 그것은 짧은 시간 동안 10개의 블러드 팩을 소비한 후 당신을 떨어뜨립니다. 테이밍 될 때까지 반복합니다.",
			"lv": "Desmodus ir pasīva mājdzīvnieka audzēšana. Ielieciet asins pakas savā ātrajā joslā un ļaujiet tai jūs noķert. Tā patērēs 10 asins pakas īsā laika posmā, tad jūs atstās. Atkārtojiet, līdz tas ir audzēts.",
			"nb": "Desmodus er en passiv tamning. Legg blodpakker på hotbar-en din og la den gripe deg. Den vil forbruke 10 blodpakker over en kort periode, deretter slippe deg. Gjenta til tam.",
			"nl": "De Desmodus is een passieve tam. Zet Bloedpakketten op je hotbar en laat het je grijpen. Het zal 10 Bloedpakketten verbruiken gedurende een korte periode, dan laat het je vallen. Herhaal tot getemd.",
			"pl": "Desmodus to pasywny oswojony. Umieść paczki z krwią na swoim pasku narzędzi i pozwól mu cię złapać. Zje 10 paczek krwi w krótkim czasie, a potem cię upuści. Powtarzaj do momentu oswojenia.",
			"pt-br": "O Desmodus é um animal de estimação passivo. Coloque Pacotes de Sangue na sua barra rápida e deixe-o agarrar você. Ele vai consumir 10 Pacotes de Sangue num curto período de tempo, depois te soltará. Repita até que esteja domesticado.",
			"ro": "Desmodus este un animal de companie pasiv. Puneți pachete de sânge pe bara dvs. de acces rapid și lăsați-l să vă prindă. Va consuma 10 pachete de sânge într-o perioadă scurtă de timp, apoi vă va lăsa. Repetați până când este îmblânzit.",
			"ru": "Десмодус - это пассивное приручение. Положите пакеты крови на вашу быструю панель и позвольте ему вас схватить. Он потребует 10 пакетов крови за короткий период времени, затем отпустит вас. Повторяйте, пока не приручится.",
			"th": "Desmodus เป็นการเทรนที่เป็นแบบผู้รับ. ใส่ Blood Packs ไว้บนแถบเร่งของคุณแล้วปล่อยให้มันจับคุณ มันจะบริโภค 10 Blood Packs ภายในระยะเวลาสั้น ๆ แล้วปล่อยคุณ ทำซ้ำจนกว่าจะถูกเทรน",
			"tr": "Desmodus pasif bir evcilleştirme türüdür. Kan Paketlerini sıcak çubuğunuza koyun ve sizi yakalamasına izin verin. Kısa bir süre içinde 10 Kan Paketi tüketir ve sizi bırakır. Evcilleştirilene kadar tekrarlayın.",
			"vi": "Desmodus là một loài thuần hóa thụ động. Đặt Gói máu lên thanh nhanh của bạn và để nó bắt bạn. Nó sẽ tiêu thụ 10 Gói máu trong một khoảng thời gian ngắn, sau đó thả bạn. Lặp lại cho đến khi được thuần hóa.",
			"zh": "Desmodus 是被动驯养的。把血包放在你的快捷栏上，让它抓住你。它会在短时间内消耗掉 10 个血包，然后把你丢下。重复这个过程，直到被驯服。",
			"zh-tw": "Desmodus 是被動馴服的。將血包放在你的快捷欄上，讓它抓住你。它會在短時間內消耗 10 個血包，然後放你下來。重複這個過程，直到被馴服。"
		},
