		"tamingNote":{
	        "en":"To tame the Equus, you must mount it immediately after the first feeding. Tap the action button each time you're prompted to feed again.",
	        "ar":"لترويض ال Equus ، يجب أن تركبه مباشرة بعد التغذية الأولى. اضغط على زر الإجراء في كل مرة يتم فيها طلب التغذية مرة أخرى.",
	        "cs":"Abyste zkrotili Equus, musíte na něj okamžitě po prvním krmení nasednout. Při každém dalším podnětu k krmení stiskněte akční tlačítko.",
	        "da":"For at tæmme Equus skal du straks efter den første fodring montere den. Tryk på handlingsknappen hver gang du bliver bedt om at fodre igen.",
	        "de":"Um das Equus zu zähmen, musst du es sofort nach der ersten Fütterung reiten. Drücke jedes Mal die Aktions-Taste, wenn du aufgefordert wirst, erneut zu füttern.",
	        "es":"Para domesticar al Equus, debes montarlo inmediatamente después de la primera alimentación. Pulsa el botón de acción cada vez que se te pida que vuelvas a alimentarlo.",
	        "fi":"Tottaaksesi Equus, sinun on noustava sen selkään heti ensimmäisen ruokinnan jälkeen. Napauta toimintopainiketta aina, kun sinua kehotetaan ruokkimaan uudelleen.",
	        "fr":"Pour apprivoiser l'Equus, vous devez le monter immédiatement après le premier repas. Appuyez sur le bouton d'action chaque fois que l'on vous invite à nourrir de nouveau.",
	        "el":"Για να εξημερώσετε το Equus, πρέπει να το ανεβάσετε αμέσως μετά την πρώτη τροφοδοσία. Πατήστε το κουμπί ενέργειας κάθε φορά που σας ζητείται να ταΐσετε ξανά.",
	        "he":"כדי לאכלא את האקווס, עליך לרכוב עליו מיד לאחר ההאכלה הראשונה. לחץ על כפתור הפעולה בכל פעם שנדרשת להאכיל שוב.",
	        "hr":"Da biste pripitomili Equus, morate ga odmah nakon prvog hranjenja popeti. Pritisnite gumb za akciju svaki put kad se zatraži da ponovno hranite.",
	        "id":"Untuk menjinakkan Equus, Anda harus menaikinya segera setelah pemberian makan pertama. Ketuk tombol aksi setiap kali Anda diminta untuk memberi makan lagi.",
	        "it":"Per addomesticare l'Equus, devi montarlo immediatamente dopo la prima alimentazione. Tocca il pulsante di azione ogni volta che ti viene richiesto di alimentare di nuovo.",
	        "ja":"エクウスをテイムするには、最初の餌やりの直後に乗らなければなりません。再度餌をやるように促されるたびに、アクションボタンをタップします。",
	        "ko":"Equus를 길들이려면 첫 번째 급식 바로 후에 타야 합니다. 다시 먹이를 주라는 메시지가 표시될 때마다 작업 버튼을 누르십시오.",
	        "lv":"Lai pieradinātu Equus, jāuzkāpj tūlīt pēc pirmās barošanas. Katru reizi, kad tiek lūgts atkal barot, piespiediet darbības pogu.",
	        "nb":"For å temme Equus, må du montere den umiddelbart etter den første matingen. Trykk på handlingsknappen hver gang du blir bedt om å mate igjen.",
	        "nl":"Om de Equus te temmen, moet je deze direct na de eerste voeding berijden. Tik op de actieknop elke keer als je opnieuw wordt gevraagd te voeden.",
	        "pl":"Aby oswoić Equus, musisz wsiąść na niego natychmiast po pierwszym karmieniu. Naciśnij przycisk akcji za każdym razem, gdy zostaniesz poproszony o ponowne karmienie.",
	        "pt-br":"Para domesticar o Equus, você deve montá-lo imediatamente após a primeira alimentação. Toque no botão de ação sempre que for solicitado para alimentar novamente.",
	        "ro":"Pentru a îmblânzi Equus, trebuie să te urci pe el imediat după prima hrănire. Apasă butonul de acțiune de fiecare dată când ți se cere să hrănești din nou.",
	        "ru":"Чтобы приручить Equus, вы должны сразу после первого кормления забраться на него. Нажимайте на кнопку действия каждый раз, когда вам предлагают покормить снова.",
	        "th":"ในการทำให้ Equus เป็นของคุณ คุณต้องขึ้นไปบนมันทันทีหลังจากการให้อาหารครั้งแรก กดปุ่มการทำงานทุกครั้งที่คุณโดนแจ้งเตือนให้อาหารอีกครั้ง",
	        "tr":"Equus'u evcilleştirmek için, ilk beslemeyi yaptıktan hemen sonra üzerine çıkmalısınız. Tekrar beslemeye yönlendiren her istekte eylem düğmesine tıklayın.",
	        "vi":"Để thuần hóa Equus, bạn phải leo lên ngay sau lần cho ăn đầu tiên. Nhấn nút hành động mỗi khi bạn được yêu cầu cho ăn lại.",
	        "zh":"要驯服Equus，你必须在第一次喂食后立即骑上它。每当提示你再次喂食时，都要点击动作按钮。",
	        "zh-tw":"要馴服Equus，您必須在第一次餵食後立即騎上它。每次提示您再次餵食時，都點擊動作按鈕。"
	    },
