		"tamingNote":{
			"en":"To tame a Ferox, you must use Element near it and then survive after it evolves into its larger form. Use element near it again, and repeat.",
			"ar":"لإرواض فروكس، يجب عليك استخدام العنصر بالقرب منه ثم البقاء على قيد الحياة بعد أن يتطور إلى شكله الأكبر. استخدم العنصر بالقرب منه مرة أخرى، وكرر العملية.",
			"cs":"Chcete-li ochočit Ferox, musíte u něj použít Element a poté přežít, když se vyvine do své větší formy. Použijte element u něj znovu a opakujte.",
			"da":"For at tæmme en Ferox skal du bruge Element tæt på den, og derefter overleve efter den udvikler sig til sin større form. Brug element tæt på den igen, og gentag.",
			"de":"Um einen Ferox zu zähmen, musst du Element in seiner Nähe verwenden und dann überleben, nachdem er sich in seine größere Form verwandelt hat. Verwende das Element erneut in seiner Nähe und wiederhole das.",
			"es":"Para domesticar a un Ferox, debes usar Element cerca de él y luego sobrevivir después de que evolucione a su forma más grande. Usa el elemento cerca de él otra vez, y repite.",
			"fi":"Keskustan Ferox, sinun on käytettävä Element lähellä sitä ja sitten selviydyttävä sen kehittymisen jälkeen suurempaan muotoonsa. Käytä elementtiä uudelleen sen lähellä, ja toista.",
			"fr":"Pour apprivoiser un Ferox, vous devez utiliser Element près de lui puis survivre après qu'il ait évolué vers sa forme la plus grande. Utilisez l'élément près de lui à nouveau, et répétez.",
			"el":"Για να εξημερώσετε έναν Ferox, πρέπει να χρησιμοποιήσετε Element κοντά του και μετά να επιβιώσετε αφού εξελιχθεί στη μεγαλύτερη μορφή του. Χρησιμοποιήστε το στοιχείο κοντά του ξανά, και επαναλάβετε.",
			"he":"כדי לאכלא את הפרוקס, עליך להשתמש באלמנט לידו ואז לשרוד לאחר שהוא מתפתח לצורה הגדולה יותר שלו. השתמש באלמנט שוב לידו, וחזור על התהליך.",
			"hr":"Da biste ukrotili Ferox, morate koristiti Element blizu njega, a zatim preživjeti nakon što evoluira u veći oblik. Ponovno koristite element u blizini, i ponovite.",
			"id":"Untuk menjinakkan Ferox, Anda harus menggunakan Element di dekatnya dan kemudian bertahan hidup setelah berevolusi menjadi bentuk yang lebih besar. Gunakan elemen di dekatnya lagi, dan ulangi.",
			"it":"Per addomesticare un Ferox, devi usare Element vicino a lui e poi sopravvivere dopo che si evolve nella sua forma più grande. Usa l'elemento vicino a lui di nuovo, e ripeti.",
			"ja":"Feroxを飼いならすには、近くでエレメントを使用して、それが大きな形に進化した後に生き残る必要があります。再度、近くでエレメントを使用して繰り返します。",
			"ko":"페록스를 길들이려면 근처에서 엘리먼트를 사용한 후 큰 형태로 진화한 후에도 생존해야 합니다. 다시 근처에서 엘리먼트를 사용하고 반복하세요.",
			"lv":"Lai pieradinātu Ferox, jums ir jālieto Elements tuvu tam, un pēc tam ir jāizdzīvo pēc tam, kad tas attīstās lielākā formā. Atkārtoti izmantojiet elementu tuvu tam, un atkārtojiet.",
			"nb":"For å temme en Ferox, må du bruke Element nær den og deretter overleve etter at den utvikler seg til sin større form. Bruk element nær den igjen, og gjenta.",
			"nl":"Om een Ferox te temmen, moet je Element dichtbij gebruiken en daarna overleven nadat het is geëvolueerd naar zijn grotere vorm. Gebruik het element weer dichtbij en herhaal.",
			"pl":"Aby oswoić Feroxa, musisz użyć Elementu w pobliżu, a potem przetrwać, gdy ewoluuje do większej formy. Użyj ponownie Elementu w pobliżu i powtórz.",
			"pt-br":"Para domesticar um Ferox, você deve usar Elemento perto dele e então sobreviver após ele evoluir para sua forma maior. Use o elemento perto dele novamente, e repita.",
			"ro":"Pentru a îmblânzi un Ferox, trebuie să folosiți Elementul lângă el și apoi să supraviețuiți după ce se transformă în forma sa mai mare. Folosiți din nou elementul lângă el și repetați.",
			"ru":"Чтобы приручить Ferox, вы должны использовать Element рядом с ним, а затем выжить после того, как он превратится в свою большую форму. Снова используйте элемент рядом с ним и повторяйте.",
			"th":"ในการทำให้ Ferox ยอมใจ คุณต้องใช้ Element ใกล้กับมัน แล้วจึงรอดชีวิตหลังจากที่มันพัฒนาเป็นรูปแบบที่ใหญ่ขึ้น ใช้ element ใกล้กับมันอีกครั้ง แล้วทำซ้ำ",
			"tr":"Bir Ferox'u evcilleştirmek için, onun yanında Element kullanmalı ve daha sonra daha büyük formuna evrimleştikten sonra hayatta kalmalısınız. Onun yanında tekrar element kullanın ve tekrarlayın.",
			"vi":"Để thuần phục Ferox, bạn phải sử dụng Element gần nó và sau đó tồn tại sau khi nó tiến hóa thành hình thức lớn hơn. Sử dụng phần tử gần nó một lần nữa, và lặp lại.",
			"zh":"要驯服Ferox，你必须在它附近使用Element，然后在它进化成更大的形式后生存下来。再次在它附近使用元素，并重复。",
			"zh-tw":"要馴服Ferox，您必須在它附近使用Element，然後在它進化成更大的形態後存活下來。再次在它附近使用元素，並重複。"
		},
