		"eats":["Tek Structures (10)|gacha","Greenhouse Structures (10)|gacha","Metal Structures (10)|gacha","Stone Structures (10)|gacha","Wooden Structures (10)|gacha","Metal Tools (Primitive) (10)|gacha","Thatch Structures (10)|gacha","Snow Owl Pellet","Stone Tools (Primitive) (10)|gacha","Metal (10)|gacha","Stone (10)|gacha","Wood (10)|gacha","Berries (10)|gacha"],
