			"ko": "Karkinos를 기절시키려면 배를 목표로 하세요. 그의 팔다리를 때리면 피해만 가하고 마비시키지는 않습니다.",
			"lv": "Lai nokautētu Karkinos, mērķē uz tā vēderu. Tā ekstremitāšu sitieni radīs tikai kaitējumu, nevis torporu.",
			"nb": "For å slå ut en Karkinos, sikter du på magen. Hvis du treffer lemmer, vil det bare forårsake skade og ikke torpor.",
			"nl": "Om een Karkinos uit te schakelen, richt je op zijn buik. Het raken van zijn ledematen veroorzaakt alleen schade, geen torpor.",
			"pl": "Aby znokautować Karkinos, celuj w jego brzuch. Uderzenie w jego kończyny spowoduje tylko uszkodzenia, a nie omdlenie.",
			"pt-br": "Para nocautear um Karkinos, mire em seu abdômen. Acertar seus membros causará apenas danos e não torpor.",
			"ro": "Pentru a doborî un Karkinos, țintește abdomenul acestuia. Lovirea membrelor sale va provoca numai daune, nu și torpor.",
			"ru": "Чтобы вырубить Karkinos, цельтесь в его живот. Удар по его конечностям причинит только урон, а не оглушение.",
			"th": "ในการทำให้ Karkinos สลบ, มุ่งเป้าที่ลำคอของมัน การตีบริเวณปลายขาของมันจะทำให้เกิดความเสียหายเท่านั้น ไม่ใช่ความง่วงนอน.",
			"tr": "Bir Karkinos'u bayıltmak için karın kısmına nişan alın. Uzuvlarına vurmak sadece hasar verir, bayılmaz.",
			"vi": "Để hạ gục Karkinos, hãy nhắm vào phần bụng của nó. Đánh vào các chi của nó chỉ gây ra thiệt hại mà không phải là tê liệt.",
