		"img":1,
		"disableKO":1,
		"disableTame":1,
		"tamingNote": {
			"en": "The Leedsichthys cannot be tamed, however, it can be trapped so that tribes can scrape off Raw Prime Meat from its body without killing it.",
			"ar": "لا يمكن ترويض Leedsichthys، ولكن يمكن حبسه حتى يتمكن القبائل من خدش اللحم الخام الأولي من جسده دون قتله.",
			"cs": "Leedsichthys nelze zkrotit, avšak může být chycen, aby kmeny mohly ze svého těla strhnout syrové prvotřídní maso bez jeho zabíjení.",
			"da": "Leedsichthys kan ikke tæmmes, men det kan fanges, så stammer kan skrabe rå Prime kød fra dens krop uden at dræbe det.",
			"de": "Der Leedsichthys kann nicht gezähmt werden, er kann jedoch gefangen werden, so dass Stämme rohes Prime Fleisch von seinem Körper kratzen können, ohne es zu töten.",
			"es": "El Leedsichthys no se puede domesticar, sin embargo, puede ser atrapado para que las tribus puedan raspar carne cruda de primera de su cuerpo sin matarlo.",
			"fi": "Leedsichthy ei voi kesyttää, mutta se voidaan ansastaa, jotta heimot voivat raaputtaa raakaa parhaan lihaa sen ruumiista tappamatta sitä.",
			"fr": "Le Leedsichthys ne peut pas être apprivoisé, cependant, il peut être piégé afin que les tribus puissent gratter de la viande crue de premier choix sur son corps sans le tuer.",
			"el": "Το Leedsichthys δεν μπορεί να εξημερωθεί, ωστόσο, μπορεί να παγιδευτεί ώστε οι φυλές να μπορούν να γδάρουν ακατέργαστο πρωτογενές κρέας από το σώμα του χωρίς να το σκοτώσουν.",
			"he": "לא ניתן לאכלא את ה Leedsichthys, אך ניתן להכניסו למלכודה כך שהשבטים יוכלו לשרוט בשר פריים גולמי מגופו מבלי להרוג אותו.",
			"hr": "Leedsichthys se ne može pripitomiti, međutim, može se zarobiti kako bi plemena mogla ostrugati sirovo najkvalitetnije meso sa njegovog tijela bez ubijanja.",
			"id": "Leedsichthys tidak dapat dijinakkan, namun, bisa ditangkap sehingga suku dapat mengikis Daging Prime Mentah dari tubuhnya tanpa membunuhnya.",
			"it": "Il Leedsichthys non può essere addomesticato, tuttavia, può essere intrappolato in modo che le tribù possano grattare la Carne Cruda di Prima qualità dal suo corpo senza ucciderlo.",
			"ja": "Leedsichthysは飼いならすことはできませんが、部族が生のプライムミートをその体から削ぎ取ることができるように、罠にかけることは可能です。",
			"ko": "Leedsichthys는 길들일 수 없지만, 부족들이 그것을 죽이지 않고 그의 몸에서 생 원시 고기를 긁어 내기 위해 그것을 갇을 수 있습니다.",
			"lv": "Leedsichthys nevar pieradināt, tomēr to var notvert, lai cilšu varētu skrapēt no tā ķermeņa izejvielas Prime gaļu, to nenokaujot.",
			"nb": "Leedsichthys kan ikke temmes, men det kan fanges slik at stammer kan skrape av Rå Prime Kjøtt fra kroppen uten å drepe det.",
			"nl": "De Leedsichthys kan niet getemd worden, maar kan wel gevangen worden zodat stammen rauw prime vlees van zijn lichaam kunnen schrapen zonder het te doden.",
			"pl": "Leedsichthys nie można oswoić, jednak można go uwięzić, aby plemiona mogły zeskrobać surowe mięso Prime z jego ciała bez zabijania go.",
			"pt-br": "O Leedsichthys não pode ser domesticado, no entanto, ele pode ser aprisionado para que as tribos possam raspar Carne Crua de Prime da sua carne sem matá-lo.",
			"ro": "Leedsichthys nu poate fi îmblânzit, totuși, poate fi prins astfel încât triburile să poată răzuire Carnea Brută Prime de pe corpul său fără a-l ucide.",
			"ru": "Leedsichthys не может быть приручен, однако его можно поймать, чтобы племена могли соскоблить с его тела сырое первосортное мясо, не убивая его.",
			"th": "Leedsichthys ไม่สามารถจับให้เป็นข้าได้ แต่สามารถจับไว้ให้เผ่าพันธุ์สามารถขูดเนื้อดิบชั้นดีจากตัวของมันโดยไม่ต้องฆ่ามัน",
			"tr": "Leedsichthys evcilleştirilemez, ancak, kabilelerin onu öldürmeden bedeninden Ham Prime Et kazıyabilmesi için tuzağa düşürülebilir.",
			"vi": "Leedsichthys không thể bị thuần dưỡng, tuy nhiên, nó có thể bị mắc bẫy để các bộ lạc có thể gọt thịt sống chất lượng cao từ cơ thể của nó mà không cần giết chết nó.",
			"zh": "Leedsichthys无法被驯服，但是，可以捕捉它，这样部落就可以在不杀死它的情况下从其身上刮取原始肉。",
			"zh-tw": "Leedsichthys無法被馴服，但是，可以捕捉它，這樣部落就可以在不殺死它的情況下從其身上刮取原始肉。"
		},
