			"el": "Για να εξημερώσεις ένα Magmasaur, πρέπει να κλέψεις ένα αυγό Magmasaur. Μοιράσου τη στρατηγική σου στην ενότητα Συμβουλές!",
			"he": "כדי לטמיע Magmasaur, עליך לגנוב ביצת Magmasaur. שתף את האסטרטגיה שלך בקטע הטיפים!",
			"hr": "Da biste ukrotili Magmasaura, morate ukrasti Magmasaurovo jaje. Podijelite svoju strategiju u odjeljku Savjeti!",
			"id": "Untuk menjinakkan Magmasaur, Anda harus mencuri telur Magmasaur. Bagikan strategi Anda di bagian Tips!",
			"it": "Per addomesticare un Magmasaur, devi rubare un uovo di Magmasaur. Condividi la tua strategia nella sezione Consigli!",
			"ja": "マグマサウルを手なずけるには、マグマサウルの卵を盗む必要があります。ヒントセクションで戦略を共有しましょう！",
			"ko": "Magmasaur을 길들이려면 Magmasaur 알을 훔쳐야 합니다. 팁 섹션에서 전략을 공유하세요!",
			"lv": "Lai pieradinātu Magmasauru, jums ir jānozog Magmasaura ola. Dalieties ar savu stratēģiju padomu sadaļā!",
			"nb": "For å temme en Magmasaur, må du stjele et Magmasaur-egg. Del strategien din i Tips-delen!",
			"nl": "Om een Magmasaur te temmen, moet je een Magmasaur-ei stelen. Deel je strategie in de Tips sectie!",
			"pl": "Aby oswoić Magmasaura, musisz ukraść jajko Magmasaura. Podziel się swoją strategią w sekcji Wskazówki!",
			"pt-br": "Para domesticar um Magmasaur, você deve roubar um ovo de Magmasaur. Compartilhe sua estratégia na seção de Dicas!",
			"ro": "Pentru a îmblânzi un Magmasaur, trebuie să furi un ou de Magmasaur. Împărtășește-ți strategia în secțiunea de sfaturi!",
			"ru": "Чтобы приручить Магмазавра, вам нужно украсть яйцо Магмазавра. Поделитесь своей стратегией в разделе советов!",
			"th": "หากต้องการทำให้ Magmasaur มั่นใจ คุณต้องขโมยไข่ Magmasaur แบ่งปันกลยุทธ์ของคุณในส่วนของเคล็ดลับ!",
			"tr": "Bir Magmasaur'u evcilleştirmek için bir Magmasaur yumurtası çalmanız gerekir. Stratejinizi İpuçları bölümünde paylaşın!",
			"vi": "Để thuần phục Magmasaur, bạn phải ăn cắp một quả trứng Magmasaur. Chia sẻ chiến lược của bạn trong phần Mẹo!",
