		"tamingNote": {
			"en": "The Megachelon is a passive tame. To tame it, find a small swarm of fish, and lure them over to a Megachelon. Swim along side the turtle with the swarm to tame it. Share your strategies in the Tips section!",
			"ar": "الMegachelon هو ترويض سلبي. لترويضه، ابحث عن سرب صغير من الأسماك، وجذبهم إلى Megachelon. سبح بجانب السلحفاة مع السرب لترويضها. شارك استراتيجياتك في قسم النصائح!",
			"cs": "Megachelon je pasivní ochočení. Aby bylo možné ho ochočit, najděte malý roj ryb a přilákejte je k Megachelonovi. Plavte se po boku želvy s rojem k jejímu ochočení. Sdílejte své strategie v sekci Tipů!",
			"da": "Megachelon er en passiv tam. For at tæmme det, skal du finde en lille stime af fisk, og lokke dem over til en Megachelon. Svøm ved siden af skildpadden med stimen for at tæmme det. Del dine strategier i Tips sektionen!",
			"de": "Der Megachelon ist eine passive Zähmung. Um ihn zu zähmen, finde einen kleinen Fischschwarm und locke ihn zu einem Megachelon. Schwimme neben der Schildkröte mit dem Schwarm, um sie zu zähmen. Teile deine Strategien im Tipps-Bereich!",
			"es": "El Megachelon es un domesticado pasivo. Para domesticarlo, encuentra un pequeño banco de peces y atraélos hacia un Megachelon. Nada al lado de la tortuga con el banco para domesticarla. ¡Comparte tus estrategias en la sección de Consejos!",
			"fi": "Megachelon on passiivinen kesyttäjä. Kesytä se löytämällä pieni parvi kaloja ja houkuttele ne Megachelonin luokse. Uida kilpikonnan rinnalla parven kanssa kesyttääksesi sen. Jaa strategiasi Vinkit-osiossa!",
			"fr": "Le Megachelon est un apprivoisement passif. Pour l'apprivoiser, trouvez un petit banc de poissons et attirez-les vers un Megachelon. Nagez aux côtés de la tortue avec le banc pour l'apprivoiser. Partagez vos stratégies dans la section Conseils!",
			"el": "Το Megachelon είναι μια παθητική εξημέρωση. Για να το εξημερώσετε, βρείτε ένα μικρό κοπάδι ψαριών και προσελκύστε τα σε ένα Megachelon. Κολυμπήστε δίπλα στη χελώνα με το κοπάδι για να την εξημερώσετε. Μοιραστείτε τις στρατηγικές σας στην ενότητα Συμβουλές!",
			"he": "הMegachelon הוא למידה פסיבית. כדי ללמד אותו, מצא נביחה קטנה של דגים, ומשוך אותם אל Megachelon. שחה לצד הצב עם הנביחה כדי ללמד אותו. שתף את האסטרטגיות שלך בפרק הטיפים!",
			"hr": "Megachelon je pasivni pripitomljavanje. Da biste ga pripitomili, pronađite malo jato riba i privucite ih na Megachelona. Plivajte uz kornjaču s jatom da biste je pripitomili. Podijelite svoje strategije u odjeljku Savjeti!",
			"id": "Megachelon adalah taming pasif. Untuk menjinakkannya, temukan sekumpulan ikan kecil, dan tarik mereka ke Megachelon. Berenang di samping kura-kura dengan kumpulan ikan untuk menjinakkannya. Bagikan strategi Anda di bagian Tips!",
			"it": "Il Megachelon è un tame passivo. Per addomesticarlo, trova un piccolo banco di pesci e attirali verso un Megachelon. Nuota accanto alla tartaruga con il banco per addomesticarla. Condividi le tue strategie nella sezione Suggerimenti!",
			"ja": "メガチェロンはパッシブテイムです。これをテイムするには、小さな魚の群れを見つけてメガチェロンに誘い込みます。その群れと一緒にカメの側を泳いでテイムします。あなたの戦略をヒントセクションで共有してください！",
			"ko": "메가첼론은 수동적인 테이밍입니다. 테이밍하려면 작은 물고기 떼를 찾아 메가첼론에게 유인합니다. 떼와 함께 거북이 옆을 수영하여 테이밍하세요. 팁 섹션에서 전략을 공유하세요!",
			"lv": "Megachelon ir pasīvs mājnieks. Lai to pieradinātu, atrodi nelielu zivju pulku un pievilini to pie Megachelon. Peldēt blakus bruņurupucim ar pulku, lai to pieradinātu. Dalieties ar savām stratēģijām Padomiem sadaļā!",
			"nb": "Megachelon er en passiv tam. For å temme den, finn en liten stim med fisk, og lokk dem over til en Megachelon. Svøm ved siden av skilpadden med stimen for å temme den. Del strategiene dine i Tips-seksjonen!",
			"nl": "De Megachelon is een passieve tam. Om het te temmen, vind je een kleine school vissen, en lok je ze naar een Megachelon. Zwem naast de schildpad met de school om hem te temmen. Deel je strategieën in de Tips sectie!",
			"pl": "Megachelon jest biernym oswojeniem. Aby go oswoić, znajdź małe stado ryb i przyciągnij je do Megachelona. Płyń obok żółwia ze stadem, aby go oswoić. Udostępnij swoje strategie w sekcji Wskazówki!",
			"pt-br": "O Megachelon é um tame passivo. Para domesticá-lo, encontre um pequeno cardume de peixes e atraia-os para um Megachelon. Nade ao lado da tartaruga com o cardume para domesticá-la. Compartilhe suas estratégias na seção de Dicas!",
			"ro": "Megachelon este un animal de companie pasiv. Pentru a-l îmblânzi, găsește un mic card de pești și atrage-i către un Megachelon. Înoată alături de țestoasă cu cardul pentru a o îmblânzi. Împărtășește-ți strategiile în secțiunea de Sfaturi!",
			"ru": "Мегахелон - это пассивное приручение. Чтобы приручить его, найдите небольшую стаю рыб и замани их к мегахелону. Плавайте рядом с черепахой со стаей, чтобы приручить ее. Делитесь своими стратегиями в разделе Советы!",
			"th": "Megachelon เป็นการจับง่ายแบบเผื่อเลี้ยง การจับง่าย คุณจะต้องหาฝูงปลาขนาดเล็กแล้วนำไปยัง Megachelon ว่ายน้ำไปด้วยกับเต่าด้วยฝูงปลาเพื่อจับง่ายแบบเผื่อเลี้ยง แชร์กลยุทธ์ของคุณในส่วนของเคล็ดลับ!",
			"tr": "Megachelon pasif bir evcilleştirmedir. Onu evcilleştirmek için, küçük bir balık sürüsü bulun ve onları bir Megachelon'a çekin. Sürü ile birlikte kaplumbağanın yanında yüzerek onu evcilleştirin. Stratejilerinizi İpuçları bölümünde paylaşın!",
			"vi": "Megachelon là một loài thú nuôi thụ động. Để thuần phục nó, hãy tìm một đàn cá nhỏ và dẫn chúng đến Megachelon. Bơi cùng rùa và đàn cá để thuần phục nó. Chia sẻ chiến lược của bạn trong phần Mẹo!",
			"zh": "Megachelon是被动驯服的。要驯服它，找到一小群鱼，将它们引诱到Megachelon。和鱼群一起在海龟旁边游泳以驯服它。在提示部分分享你的策略！",
			"zh-tw": "Megachelon是被動馴服的。要馴服它，找到一小群魚，並將它們誘到Megachelon。與魚群一起在海龜旁邊游泳以馴服它。在提示部分分享你的策略！"
		},
