		"tamingNote": {
			"en":"To tame a Reaper, you must get a Reaper Queen to impregnate you. Visit the Tips section to see detailed strategies — or add your own!",
			"ar":"لكي تروض Reaper ، يجب أن تجعل ملكة Reaper تحملك. زور قسم النصائح لرؤية استراتيجيات مفصلة - أو أضف الخاصة بك!",
			"cs":"Chcete-li zkrotit Reaper, musíte se nechat oplodnit od Reaper Queen. Navštivte sekci Tipů, kde najdete detailní strategie - nebo přidejte vlastní!",
			"da":"For at tæmme en Reaper, skal du have en Reaper Queen til at gøre dig gravid. Besøg Tips-sektionen for at se detaljerede strategier - eller tilføj din egen!",
			"de":"Um einen Reaper zu zähmen, müssen Sie sich von einer Reaper-Königin schwängern lassen. Besuchen Sie den Tipps-Bereich, um detaillierte Strategien zu sehen – oder fügen Sie Ihre eigene hinzu!",
			"es":"Para domesticar a un Reaper, debes conseguir que una Reina Reaper te impregne. Visita la sección de Consejos para ver estrategias detalladas, ¡o agrega la tuya!",
			"fi":"Hallitaksesi Reaperin, Reaper Queenin on tehtävä sinut raskaaksi. Käy Vinkit-osiossa nähdäksesi yksityiskohtaiset strategiat - tai lisää omasi!",
			"fr":"Pour apprivoiser un Reaper, vous devez vous faire féconder par une reine Reaper. Consultez la section Astuces pour voir des stratégies détaillées - ou ajoutez la vôtre!",
			"el":"Για να εξημερώσεις έναν Reaper, πρέπει να σε κάνει έγκυο μια Reaper Queen. Επισκεφτείτε την ενότητα Συμβουλές για να δείτε λεπτομερείς στρατηγικές - ή προσθέστε τη δική σας!",
			"he":"כדי לרסן ריפר, עליך לקבל התעברות מאת המלכה ריפר. בקר בקטע הטיפים כדי לראות אסטרטגיות מפורטות - או להוסיף את שלך!",
			"hr":"Da biste ukrotili Reaper, morate natjerati Reaper Queen da vas zapregne. Posjetite odjeljak s savjetima da biste vidjeli detaljne strategije - ili dodajte svoje!",
			"id":"Untuk menjinakkan Reaper, Anda harus membuat Reaper Queen menghamili Anda. Kunjungi bagian Tips untuk melihat strategi rinci - atau tambahkan milik Anda sendiri!",
			"it":"Per addomesticare un Reaper, devi far sì che una Regina Reaper ti metta incinta. Visita la sezione Consigli per vedere strategie dettagliate - o aggiungi la tua!",
			"ja":"リーパーを飼いならすには、リーパークイーンにあなたを妊娠させなければなりません。ヒントセクションを訪れて詳細な戦略を見るか、自分自身を追加してください！",
			"ko":"리퍼를 길들이려면 리퍼 퀸이 당신을 임신시켜야합니다. 팁 섹션을 방문하여 자세한 전략을 확인하거나 자신의 것을 추가하세요!",
			"lv":"Lai pieradinātu Reaper, jums jāļauj Reaper Queen jūs apaugļot. Apmeklējiet Padomu sadaļu, lai redzētu detalizētas stratēģijas - vai pievienojiet savu!",
			"nb":"For å temme en Reaper, må du få en Reaper Queen til å gjøre deg gravid. Besøk Tips-seksjonen for å se detaljerte strategier - eller legg til din egen!",
			"nl":"Om een Reaper te temmen, moet je een Reaper Queen je laten bevruchten. Bezoek de Tips-sectie om gedetailleerde strategieën te zien - of voeg je eigen toe!",
			"pl":"Aby oswoić Reaper, musisz sprawić, aby Reaper Queen Cię zapłodniła. Odwiedź sekcję Porady, aby zobaczyć szczegółowe strategie - lub dodaj własną!",
			"pt-br":"Para domesticar um Reaper, você deve fazer uma Reaper Queen te engravidar. Visite a seção Dicas para ver estratégias detalhadas - ou adicione a sua própria!",
			"ro":"Pentru a îmblânzi un Reaper, trebuie să faci o regină Reaper să te însămânțeze. Vizitează secțiunea de sfaturi pentru a vedea strategii detaliate - sau adaugă propriul tău!",
			"ru":"Чтобы приручить Reaper, вы должны заставить королеву Reaper забеременеть вас. Посетите раздел Советы, чтобы увидеть подробные стратегии — или добавьте свою!",
			"th":"เพื่อจะทำให้ Reaper เป็นของคุณ คุณต้องทำให้ Reaper Queen ทำคุณตั้งครรภ์ ไปที่ส่วนของคำแนะนำเพื่อดูกลยุทธ์ที่ละเอียด — หรือเพิ่มของคุณเอง!",
			"tr":"Bir Reaper'ı evcilleştirmek için, bir Reaper Queen'in sizi hamile bırakmasını sağlamalısınız. Detaylı stratejileri görmek için İpuçları bölümünü ziyaret edin - veya kendi stratejinizi ekleyin!",
			"vi":"Để thuần phục một Reaper, bạn phải để Reaper Queen thụ tinh cho bạn. Truy cập phần Mẹo để xem các chiến lược chi tiết - hoặc thêm chiến lược của chính bạn!",
			"zh":"要驯服收割者，你必须让收割者女王让你怀孕。访问“提示”部分查看详细策略 - 或者添加你自己的！",
			"zh-tw":"要馴服收割者，您必須讓收割者皇后使您懷孕。請參觀提示部分查看詳細策略 - 或者添加自己的！"
		},
