		"tamingNote": {
			"en":"To tame a Wyvern, survivors must steal a Wyvern egg. Once hatched, Wyvern babies need to be fed Wyvern Milk, which can be obtained by knocking out a female Wyvern.",
			"ar":"لإلحاق Wyvern، يجب على الناجين سرقة بيضة Wyvern. بمجرد الفقس، يحتاج أطفال Wyvern إلى تغذية Wyvern Milk، والتي يمكن الحصول عليها عن طريق ضرب Wyvern الأنثى.",
			"cs":"Chcete-li zkrotit Wyvern, musí přeživší ukrást vejce Wyvern. Jakmile se vylíhnou, Wyvern miminka musí být krmena Wyvern mlékem, které lze získat omráčením samice Wyvern.",
			"da":"For at tæmme en Wyvern, skal overlevende stjæle et Wyvern-æg. Når det er klækket, skal Wyvern-babyer fodres med Wyvern-mælk, som kan opnås ved at slå en hun-Wyvern ud.",
			"de":"Um einen Wyvern zu zähmen, müssen Überlebende ein Wyvern-Ei stehlen. Sobald sie geschlüpft sind, müssen Wyvern-Babys mit Wyvern-Milch gefüttert werden, die erhalten werden kann, indem man eine weibliche Wyvern ausschaltet.",
			"es":"Para domesticar a un Wyvern, los supervivientes deben robar un huevo de Wyvern. Una vez eclosionado, los bebés Wyvern necesitan ser alimentados con Leche de Wyvern, que se puede obtener al noquear a una Wyvern hembra.",
			"fi":"Wyvernin kesyttämiseksi eloonjääneiden on varastettava Wyvern-muna. Kun se on kuoriutunut, Wyvern-vauvoja on ruokittava Wyvern-maidolla, joka voidaan saada lyömällä naispuolinen Wyvern tajuttomaksi.",
			"fr":"Pour apprivoiser un Wyvern, les survivants doivent voler un œuf de Wyvern. Une fois éclos, les bébés Wyvern doivent être nourris au lait de Wyvern, qui peut être obtenu en assommant une Wyvern femelle.",
			"el":"Για να εξημερώσετε ένα Wyvern, οι επιζώντες πρέπει να κλέψουν ένα αυγό Wyvern. Μόλις εκκολαπτεί, τα μωρά Wyvern πρέπει να τραφούν με γάλα Wyvern, το οποίο μπορεί να αποκτηθεί εξοπλισμένος μια θηλυκή Wyvern.",
			"he":"כדי לרדוף את Wyvern, הניצולים חייבים לגנוב ביצת Wyvern. לאחר הדגירה, צריך להאכיל את תינוקות Wyvern עם חלב Wyvern, שניתן לקבל על ידי הכות בנקבת Wyvern.",
			"hr":"Da bi ukrotili Wyvern, preživjeli moraju ukrasti Wyvernovo jaje. Jednom kad se izlegu, Wyvern bebe moraju biti hranjene Wyvern mlijekom, koje se može dobiti tako da onesvijestite ženski Wyvern.",
			"id":"Untuk menjinakkan Wyvern, para survivor harus mencuri telur Wyvern. Setelah menetas, bayi Wyvern perlu diberi susu Wyvern, yang bisa didapatkan dengan menjatuhkan Wyvern betina.",
			"it":"Per addomesticare un Wyvern, i sopravvissuti devono rubare un uovo di Wyvern. Una volta schiuso, i cuccioli di Wyvern devono essere nutriti con il latte di Wyvern, che può essere ottenuto mettendo KO una Wyvern femmina.",
			"ja":"ワイバーンを手懐けるには、生存者がワイバーンの卵を盗む必要があります。孵化したら、ワイバーンの赤ちゃんはワイバーンミルクを飲ませる必要があります。これは、メスのワイバーンをノックアウトすることで得られます。",
			"ko":"와이번을 길들이려면, 생존자들이 와이번의 알을 훔쳐야 합니다. 알이 부화하면, 와이번 아기들은 와이번 우유를 먹여야 하는데, 이는 여성 와이번을 기절시켜 얻을 수 있습니다.",
			"lv":"Lai pieradinātu Wyvern, izdzīvojušajiem ir jānozog Wyvern ola. Kad tā izšķiļas, Wyvern mazuļiem ir jābaro ar Wyvern pienu, ko var iegūt, apreibinot mātīti Wyvern.",
			"nb":"For å temme en Wyvern, må overlevende stjele et Wyvern-egg. Når det er klekket, trenger Wyvern-babyer å bli matet med Wyvern-melk, som kan oppnås ved å slå ut en kvinnelig Wyvern.",
			"nl":"Om een Wyvern te temmen, moeten overlevenden een Wyvern-ei stelen. Eenmaal uitgekomen, moeten Wyvern-baby's gevoed worden met Wyvern-melk, die kan worden verkregen door een vrouwelijke Wyvern knock-out te slaan.",
			"pl":"Aby oswoić Wyverna, ocalali muszą ukraść jajko Wyverna. Po wykluciu, młode Wyverny muszą być karmione Mlekiem Wyverna, które można uzyskać, ogłuszając samicę Wyverna.",
			"pt-br":"Para domar um Wyvern, os sobreviventes devem roubar um ovo de Wyvern. Uma vez chocado, os filhotes de Wyvern precisam ser alimentados com Leite de Wyvern, que pode ser obtido ao nocautear uma Wyvern fêmea.",
			"ro":"Pentru a îmblânzi un Wyvern, supraviețuitorii trebuie să fure un ou de Wyvern. Odată clocit, puii de Wyvern trebuie hrăniți cu lapte de Wyvern, care poate fi obținut prin doborârea unui Wyvern femelă.",
			"ru":"Чтобы приручить виверну, выжившие должны украсть яйцо виверны. Как только они вылупятся, детёнышей виверны нужно кормить молоком виверны, которое можно получить, вырубив самку виверны.",
			"th":"ในการจับใจ Wyvern ผู้รอดชีวิตต้องขโมยไข่ Wyvern เมื่อฟักจากไข่เรียบร้อย ลูก Wyvern ต้องการนม Wyvern ซึ่งสามารถได้มาจากการตบหัว Wyvern เพศเมีย",
			"tr":"Bir Wyvern'i evcilleştirmek için, hayatta kalanların bir Wyvern yumurtası çalması gerekir. Bir kere çıktıktan sonra, Wyvern yavrularının Wyvern Sütü ile beslenmesi gerekiyor, bu da bir dişi Wyvern'i bayıltarak elde edilebilir.",
			"vi":"Để thuần phục một Wyvern, những người sống sót phải ăn cắp một quả trứng Wyvern. Một khi nó nở, các con Wyvern cần được cho ăn Sữa Wyvern, có thể được thu được bằng cách hạ gục một con Wyvern cái.",
			"zh":"要驯服飞龙，幸存者必须偷一个飞龙的蛋。一旦孵化，飞龙宝宝需要用飞龙牛奶喂养，可以通过击晕一只雌性飞龙获得。",
			"zh-tw":"要馴服飛龍，生還者必須偷取一顆飛龍的蛋。一旦孵化，飛龍幼崽需要被餵食飛龍奶，這可以通過擊昏一隻雌性飛龍獲得。"
		},
